<node ID="C1C14E86-791A-4004-9530-01EBC0D23E09" TEXT="next &#26041;&#27861;" COLOR="#344853" POSITION="right" STYLE="fork"><edge COLOR="#389237" WIDTH="6" /><font NAME="PingFangSC-Regular" SIZE="18" /><richcontent TYPE="NOTE"><html><head></head>
<body><p><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>所谓迭代器，其实就是一个具有</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> next</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>()</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> </span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>方法的对象，每次调用</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> next</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>()</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> </span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>都会返回一个结果对象，该结果对象有两个属性，</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>value </span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>表示当前的值，</span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>done </span><span style='color: rgba(27, 30, 34, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>表示遍历是否结束。</span></p></body>
</html>
</richcontent>
