<node ID="617D85D2-F228-4762-BE26-9B6384712557" TEXT="return &#26041;&#27861;" COLOR="#344853" POSITION="right" STYLE="fork"><edge COLOR="#DC2128" WIDTH="6" /><font NAME="PingFangSC-Regular" SIZE="18" /><richcontent TYPE="NOTE"><html><head></head>
<body><p><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '>return </span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>方法的使用场合是，如果</span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> for...of </span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>循环提前退出（通常是因为出错，或者有</span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> break </span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>语句或</span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> continue </span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>语句），就会调用</span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> return </span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>方法。如果一个对象在完成遍历前，需要清理或释放资源，就可以部署</span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Helvetica"; -cocoa-font-postscriptname: "Helvetica"; '> return </span><span style='color: rgba(87, 95, 105, 1.000000); font: 14px "Times"; -cocoa-font-postscriptname: "Times-Roman"; '>方法。</span></p></body>
</html>
</richcontent>
